      			</div>
      			<div 
              className={styles.loginButton} 
              onClick={onLoginButtonClick} 
              aria-label="Login"
            >
        				<div className={styles.loginButtonChild} />
        				<div className={styles.login}>login</div>
      			</div>
    		</div>
  	);
};

export default LandingPage;
